import 'package:json_annotation/json_annotation.dart';part 'user_md_req.g.dart';@JsonSerializable(anyMap: true)class UserModelReq {  String phoneNumber;  String password;  bool isAdmin;  @override  UserModelReq({    required this.phoneNumber,    required this.password,    required this.isAdmin,  });  factory UserModelReq.fromJson(Map json) => _$UserModelReqFromJson(json);  Map toJson() => _$UserModelReqToJson(this);}